import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './index.css';
import 'tachyons';
import { Lockone } from './components/pages/Lockone';

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path="/" component={Lockone} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
